import React from 'react';
import ReactDOM from 'react-dom';
import Navbar from './components/NavigationBar/Navbar';
import ImageComponent from './components/ImageComponent/ImageComponent';
import AraSi from './images/backgroundImageAraSi.jpg';
import Cartell from './images/backgroundImage.jpg';

const Inici = () => {
  return (
    <div>
      <Navbar />
      <ImageComponent src={AraSi} alt="Ara si" text="ARA SI" />
      <ImageComponent src={Cartell} alt="Cartell" text="Properament Ventra d'entrades" />
    </div>
  );
};

ReactDOM.render(<Inici />, document.getElementById('root'));
